// TypeScript interfaces for type safety
interface ClientBranding {
  name: string;
  logo: string | null;
  colors: {
    primary: string;
    secondary: string;
    accent: string;
    background: string;
    surface: string;
    text: string;
  };
}

interface FramePosition {
  x: number;
  y: number;
  qrSize: number;
}

interface Frame {
  svg: string;
  position: FramePosition;
  width: number;
  height: number;
}

interface Frames {
  [key: string]: Frame;
}

interface LogoConfig {
  enabled: boolean;
  url: string | null;
}

interface ExportFormat {
  type: string;
  quality: number;
}

interface ExportSettings {
  formats: {
    [key: string]: ExportFormat;
  };
}

